import './App.css';
import Header from './components/Header.js';
import Footer from './components/Footer.js'
import { Container} from 'react-bootstrap'
import './bootstrap.min.css'
function App() {
  return (
        <div>
            <Header/>
            <Container>
                <main>
                    <h1>my app</h1>
                </main>
            </Container>
            <Footer/>
        </div>
  );
}

export default App;
